/**
* Computes the wheel velocities of omni directional wheeled robots given final orientation of the robot.
*
* @param radius - radius of the wheel
* @param wheelbase - distance of wheel from the center
* @param x0 - initial x position in meters
* @param y0 - initial y position in meters
* @param psi0 - initial orientation in degrees
* @param x1 - final x position in meters
* @param y1 - final y position in meters
* @param psi1 - final orientation in degrees
* @param time - time in seconds
* @throws first argument must be a positive integer
* @throws second argument must be a positive integer
* @returns wheel velocities
*
* @example
*
* var z = omni_directional( 0.1, 0.4, 0.0, 0.0, 0.0, 0.5, 0.0, 0.0, 1.0 );
* // z => <Float64Array>[ 0.0, ~-4.33, ~4.33 ]
*/
declare function omni_directional( radius: number, wheelbase: number, x0: number, y0: number, psi0: number, x1: number, y1: number, psi1: number, time: number ): Array<number>;


// EXPORTS //

export = omni_directional;